node.label:
Пример:
{ "name" : "administrator" }
Значения string/text.

Пример:
{ "id" : 30 }
Значения integer или float: -2, 17, -1.8, 10.3.

Пример:
{"role": {"name" : "administrator", "id" : 30}}
Ключ - строка, а значение любого типа.

Пример:
{ "action" : [ "read", "write", 1, null ] }
Список любых допустимых типов данных.

Пример:
{ "enabled" : true, "enabled" : false }
Значения true or false.

Пример:
{ "role" : null }
Указывает, что значение отсутствует.

Cтрока, записанная в двойных кавычках.
Пример:
{ "name" : "..." }

{
	"dictionaries": [
		{
			"name": "Roles Dictionary",
			"description": "Справочник ролей",
			"dictionaryGroups": {
				"administrators": [
					{
						"name": "administrator",
						"enabled": true
					}, {
						"name": "superuser",
						"enabled": true
					}
				],
				"accountants": [
					{
						"name": "accountant",
						"enabled": true
					}
				]
			}
		}
	]
}

Пример:
{ "description": "Справочники ролей" }
Значения string/text. Допустимо: "","text"

Пример:
{ "maxItems": 1 }
Значения integer или float: -4, 12, -4.1, 13.3

Пример:
{ "enum": ["administrator", "superuser"] }
Список любых допустимых типов данных

Пример:
{ "uniqueItems": true }
Значения true/false.

Пример:
{ value" : null }
Используются для проверки на null.

Пример:
{ "minLength": 1 }
Значения integer: 1000, -125, 0

Пример:
{"type": ["number", "string", "null", "boolean"]}
{"type": "array"}
Указывает тип данных, который будет использоваться схемой. Это ключевое слово не является обязательным, и значением ключевого слова может быть строка, представляющая допустимый тип данных, или массив строк, представляющих допустимые типы данных.

Пример:
{ "const": "user" }
Выполняется проверка на точное соответсвие заданному значению

Пример:
{ "enum": [ "administrator", "superuser" ] }
Выполняется проверка на совпадение с хотя бы 1 значением

Пример:
"employees": {
	"description": "Сотрудники",
	"type": "array",
	"uniqueItems": true,
	"items": {
	  "type": "object",
		"properties": {
			"name": {
				"type": "string",
				"enum": ["employee"],
				"enumNames": ["Сотрудник"]
					 },
			"enabled": {
				"type": "boolean",
				"default": true
				}
			},
		"additionalProperties": false
	}
}
Объект проверяется как по наименованию ключа, так и по ограничениям на значение
